import React from 'react'

class Table extends Component {
  render() {
    return (
      <table>
        <tr>
          <th>Category</th>
          <th>Content</th>
        </tr>
        <td>{this.props.category}</td>
        <td>{this.props.content}</td>
        <td>
          <button>Edit</button>
          <button>Delete</button>
        </td>
      </table>
    )
  }
}

export default Table
